import React from 'react';
import styled from 'styled-components';

const Wallpaper: React.FC = ({ children }) => {
    return (
        <Wall>
            {children}
        </Wall>
    )
}

export default Wallpaper;

const Wall = styled.div`
    width: 100%;
    height: 100%;
    background: linear-gradient(
        white, ${({ theme }) => theme.colors.mainBlue}
    );
`;
